import React from "react";
import css from "@emotion/css";

const ConfirmationModal = () => {
  <section
    className="w-full h-full fixed top-o bottom-0 left-0 right-0"
    css={css`
      background-color: rgba(0, 0, 0, 0.4);
    `}
  >
    <div
      className="absolute bg-white w-64 rounded shadow-2xl p-4"
      css={css`
        transform: translate(-50%, -50%);
        top: 50%;
        left: 50%;
      `}
    >
      <h3>Confirmation</h3>
      <p>Do you realy want to delete the Ph.D Details ?</p>
      <div>
        <button
          type="button"
          className="bg-red p-2 text-sm text-white text-center font-sans"
        >
          Yes
        </button>
        <button
          type="button"
          className="bg-blue-66 p-2 text-sm text-white text-center font-sans"
        >
          No
        </button>
      </div>
    </div>
  </section>;
};
export default ConfirmationModal;
